const imgLink = 'https://i.postimg.cc/GhTKWxyY/IMG-6071.jpg'
const sqSize = 100
const alt = 'Profile Picture'

function Pfp({ meta }) {
  return <img 
    src={meta.imgLink}
    style={{width:'100px', height:'100px', objectFit:'cover', borderRadius:'50%'}} 
    alt='Profile Picture'
  />
}

function Bio({ meta }) {
  return (
    <div style={{display:'grid', placeItems: 'center'}}>
      <Pfp/>
      <div style={{width: '50vw'}}>
        <p style={{color:'white'}}>{meta.bio}</p>
      </div>
    </div>
  )
}

export { Bio }
